import React from 'react'
import "../CSS/Right_Side.css"
import Particles from 'react-particles-js';

function Right_Side() {
    return (

        <div className="right-side">

            <Particles
                
                params={{
                    "particles": {
                        "number": {
                            "value": 70
                        },
                        "size": {
                            "value": 1
                        }
                    },
                    "interactivity": {
                        "events": {
                            "onhover": {
                                "enable": true,
                                "mode": "repulse"
                            }
                        }
                    }
                    
                }}>



            </Particles>
            <div className='home-intro-div' style={{ marginLeft: '50px', }}>
                <br></br>
                <h1 style={{ color: 'white', fontSize: '70px', margin:'0' }}>Hi,</h1>
                <h1 style={{ color: 'white', fontSize: '70px', margin:'0' }}>I'm Afran,</h1>
                <h1 style={{ color: 'white', fontSize: '70px', margin:'0' }}>Hi,I'm Afran,<br /> App & Web Developer.</h1>

                <h3 style={{ color: 'white', }}>Full Stack Developer | Content Creator | Entrepreneur</h3>

            </div>

        </div>
    )
}

export default Right_Side
